import React from "react";
import BG from "../assets/BG.mp4";
const LandHome = () => {
  return (
    <div className="landHome">
      <video
        autoPlay
        loop
        muted
        disablePictureInPicture
        controlsList="nodownload"
        style={{
        position:'absolute',
          height: "100%",
          width: "100%",
          objectFit: "cover",
          zIndex: "1",
        }}
      >
        <source src={BG} type="video/mp4" />
      </video>

    </div>
  );
};

export default LandHome;
